import React from 'react';
import {reduxForm, Field} from 'redux-form';

const LoginForm = () =>{
    return (
        <form>
            <Field name='login' component='input'/>
            <Field name='password' component='input'/>
            <Field name='login' component='input'/>
        </form>
    )
}    

const LoginReduxForm = reduxForm ({form: 'login'})(LoginForm);

 const Login = (props) => {
    return <h1>LOGIN
        <LoginReduxForm/>
    </h1>
}

export default Login;
